import React from 'react';

const AppLayout = ({ children }) => {
	return (
		<>
			<AppHeader></AppHeader>
			<main>
				<MainWrapper>
					<Row>
						<MainContainer>
							<Col
								xs={{ span: 24, offset: 0 }}
								sm={{ span: 9, offset: 3 }}
								md={{ span: 9, offset: 3 }}
								xl={{ span: 7, offset: 5 }}
							>
								<DescriptionWrapper>
									<DescriptionTitle>{descriptionTitle}</DescriptionTitle>
									<DescriptionContent>{descriptionContent}</DescriptionContent>
								</DescriptionWrapper>
							</Col>
							<Col
								xs={{ span: 16, offset: 4 }}
								sm={{ span: 9, offset: 0 }}
								md={{ span: 9, offset: 0 }}
								xl={{ span: 6, offset: 1 }}
							>
								<SignupForm></SignupForm>
							</Col>
						</MainContainer>
					</Row>
				</MainWrapper>
			</main>
			<footer></footer>
		</>
	);
};

export default AppLayout;
